import React, { Component } from 'react';
import './Navbar.css';

class Navbar extends Component {

    render() {
        return (
            <navbar>
                <li><b>Memory Game</b></li>
                <li>New Game</li>
            </navbar>
        );
    }
}

export default Navbar;
